type String struct {
	str string
}

func newPalindrome(s string) String {
	return String{s}
}

func (s String) isPalindrome() bool {
	r := []rune(s.str)
	for i, j := 0, len(r)-1; i < len(r)/2; i, j = i+1, j-1 {
		if r[i] != r[j] {
			return false
		}
	}

	return true
}

